import React, { Component } from 'react';

export default class Todo extends Component {
    constructor(props) {
        super(props);
        this.state = {
            list: ['todo 1', 'todo 2', 'todo 3'],
        };
    }
    render() {
        return (
            <div>
                <section>
                    <form>
                        <input type="text" placeholder="Add todo"></input>
                        <button>Add</button>
                        <ul>
                            {this.state.list.map(item => (
                                <li>{item}</li>
                            ))}
                        </ul>
                    </form>
                </section>
            </div>
        );
    }
}
